import {
  Routes,
  Route,
  useNavigationType,
  useLocation,
} from "react-router-dom";
import Web192013 from "./pages/Web192013";
import Web19202 from "./pages/Web19202";
import Web192015 from "./pages/Web192015";
import Web192014 from "./pages/Web192014";
import Web192011 from "./pages/Web192011";
import Web19209 from "./pages/Web19209";
import Web19208 from "./pages/Web19208";
import Web19205 from "./pages/Web19205";
import Web19204 from "./pages/Web19204";
import Web19203 from "./pages/Web19203";
import Web19201 from "./pages/Web19201";
import { useEffect } from "react";

function App() {
  const action = useNavigationType();
  const location = useLocation();
  const pathname = location.pathname;

  useEffect(() => {
    if (action !== "POP") {
      window.scrollTo(0, 0);
    }
  }, [action]);

  useEffect(() => {
    let title = "";
    let metaDescription = "";

    //TODO: Update meta titles and descriptions below
    switch (pathname) {
      case "/":
        title = "";
        metaDescription = "";
        break;
      case "/web-1920-2":
        title = "";
        metaDescription = "";
        break;
      case "/web-1920-15":
        title = "";
        metaDescription = "";
        break;
      case "/web-1920-14":
        title = "";
        metaDescription = "";
        break;
      case "/web-1920-11":
        title = "";
        metaDescription = "";
        break;
      case "/web-1920-9":
        title = "";
        metaDescription = "";
        break;
      case "/web-1920-8":
        title = "";
        metaDescription = "";
        break;
      case "/web-1920-5":
        title = "";
        metaDescription = "";
        break;
      case "/web-1920-4":
        title = "";
        metaDescription = "";
        break;
      case "/web-1920-3":
        title = "";
        metaDescription = "";
        break;
      case "/web-1920-1":
        title = "";
        metaDescription = "";
        break;
    }

    if (title) {
      document.title = title;
    }

    if (metaDescription) {
      const metaDescriptionTag = document.querySelector(
        'head > meta[name="description"]'
      );
      if (metaDescriptionTag) {
        metaDescriptionTag.content = metaDescription;
      }
    }
  }, [pathname]);

  return (
    <Routes>
      <Route path="/" element={<Web192013 />} />

      <Route path="/web-1920-2" element={<Web19202 />} />

      <Route path="/web-1920-15" element={<Web192015 />} />

      <Route path="/web-1920-14" element={<Web192014 />} />

      <Route path="/web-1920-11" element={<Web192011 />} />

      <Route path="/web-1920-9" element={<Web19209 />} />

      <Route path="/web-1920-8" element={<Web19208 />} />

      <Route path="/web-1920-5" element={<Web19205 />} />

      <Route path="/web-1920-4" element={<Web19204 />} />

      <Route path="/web-1920-3" element={<Web19203 />} />

      <Route path="/web-1920-1" element={<Web19201 />} />
    </Routes>
  );
}
export default App;
